import React from "react";
import { Button } from 'react-bootstrap';

const Navbar = (props) => {
    return (
        <div>
            <div>
                <h1>Index</h1>
                <Button variant="primary">Primary</Button>{' '}
            </div>
        </div>
    )
}

export default Navbar;
